css:
atom-text-editor.editor .relative.current-line {
  color: #6494ed;
}
atom-text-editor.editor .absolute {
  display: none;
}
atom-text-editor.editor .gutter[gutter-name='relative-numbers'] {
  display: none;
}
atom-text-editor.vim-mode.insert-mode.editor .absolute,
atom-text-editor.vim-mode-plus.insert-mode.editor .absolute {
  display: inline;
}
atom-text-editor.vim-mode.insert-mode.editor .relative,
atom-text-editor.vim-mode-plus.insert-mode.editor .relative {
  display: none;
}
atom-text-editor.editor .show-absolute .absolute {
  display: inline;
  margin-right: 1em;
  color: rgba(248, 248, 242, 0.5);
}
atom-text-editor.editor .show-absolute .relative {
  display: inline !important;
}
